import React from 'react';
import { Line } from "react-chartjs-2";
import "./ProductionOutput.css"

import {
    Button,
    ButtonGroup,
    Card,
    CardHeader,
    CardBody,
    CardTitle,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    UncontrolledDropdown,
    Label,
    FormGroup,
    Input,
    Table,
    Row,
    Col,
    UncontrolledTooltip,
  } from "reactstrap";



  import {
    LineChart_ProductionOutput, 
  } from "variables/charts";


const ProductionOutput = ({LineChart_ProductionOutput_Example1}) => {

        return (
            <>

            <div className='ProductionOutput'>
              <div className='infocardrow-header'>






                    <Line
                      data={LineChart_ProductionOutput[LineChart_ProductionOutput_Example1]}
                      options={LineChart_ProductionOutput.options}
                    />


              </div>


            </div>




     </>
        )

};

export default ProductionOutput;
